import React from 'react'
import {makeStyles} from '@material-ui/core/styles'
import {Card, CardMedia, Typography } from '@material-ui/core'


const useStyles = makeStyles(theme => ({
  // hexagon: {
  //   position: 'relative',
  //   width: '300px' ,
  //   height: '173.21px',
  //   backgroundColor: '#64C7CC',
  //   margin: '86.60px 0',

  //   '&:before, &:after': {
  //     content: '""',
  //     position: 'absolute',
  //     width: '0',
  //     borderLeft: '150px solid transparent',
  //     borderRight: '150px solid transparent',
  //   },

  //   '&::before': {
  //     bottom: '100%',
  //     borderBottom: '86.60px solid #64C7CC'
  //   },

  //   '&::after': {
  //     top: '100%',
  //     width: '0',
  //     borderTop: '86.60px solid #64C7CC'
  //   }
  // },

  root: {
    marginBottom: theme.spacing(3)
  }


}))


function Profile() {
  const classes = useStyles()

  return (
    <div className={classes.root}>
      <Card style ={{width: "240px", marginBottom: "16px"}}>
        <CardMedia
          style={{height: "280px"}}
          image="https://lp-cms-production.imgix.net/news/2019/02/taj-mahal-monkey.jpg"
        />
      </Card>
      <Typography variant="h4" style={{fontWeight: "600", opacity: "0.7"}}> who is this guy?</Typography>
      <Typography variant="sub">Hi my name is osama khan. I am from Nepal. i like Coding this is my first portfolio website</Typography>
    </div>
  )
}

export default Profile
